import React, {Component} from 'react';


class App extends Component {

  constructor() {
    super();
    this.state = { data: {} };
  }

  componentDidMount() {

    var self =this;

    fetch('https://reqres.in/api/users?page=1')
      .then(function(response) {
        return response.json()
      }).then(function(data) {
        self.setState({ data }, () => console.log(self.state));
  });
}

  render() {
      return (
        <div/>
      );
    }
  }

export default App;
